// Exit if accessed directly
if ( !defined( 'ABSPATH' ) ) {
	exit;
}

// Verify this isn't called directly.
if ( !function_exists( 'add_action' ) ) {
	echo 'Hi there!  I\'m just a plugin, not much I can do when called directly.';
	exit;
}

class PW_Image_Cleaner {

	function __construct() {

		if ( is_admin() ) {
			add_action( 'admin_init', array( $this, 'custom_admin_init' ) );
			add_action( 'admin_menu', array( $this, 'register_admin_menu' ) );
			add_action( 'wp_ajax_image_scan', array( $this, 'ajax_scan' ) );
		}

		add_action( 'template_redirect', array( $this, 'csv_redirect' ) );
	}

	function custom_admin_init() {
		if ( ! function_exists( 'get_plugins' ) ) {
			require_once( ABSPATH . 'wp-admin/includes/plugin.php' );
		}

		$plugin_folder = get_plugins( '/' . plugin_basename( dirname( __FILE__ ) ) );
		$plugin_file = basename( ( __FILE__ ) );
		$version = $plugin_folder[$plugin_file]['Version'];

		wp_enqueue_style( 'pw-cleaner', plugins_url( 'assets/css/pw-cleaner.css', __FILE__ ), false, $version );
	}

	function register_admin_menu() {
		if ( empty ( $GLOBALS['admin_page_hooks']['pimwick'] ) ) {
			add_menu_page(
				__( 'PW Image Cleaner', 'pimwick' ),
				__( 'Pimwick Plugins', 'pimwick' ),
				'manage_options',
				'pimwick',
				array( $this, 'index' ),
				'data:image/svg+xml;base64,',
				6
			);

			add_submenu_page(
				'pimwick',
				__( 'PW Image Cleaner', 'pimwick' ),
				__( 'Pimwick Plugins', 'pimwick' ),
				'manage_options',
				'pimwick',
				array( $this, 'index' )
			);

			remove_submenu_page('pimwick','pimwick');
		}

		add_submenu_page(
			'pimwick',
			__( 'PW Image Cleaner', 'pimwick' ),
			__( 'PW Image Cleaner', 'pimwick' ),
			'manage_options',
			'pw-image-cleaner',
			array( $this, 'index' )
		);
	}

	function index() {

		$cleaner = $this->init_cleaner();

		include( 'ui/index.php' );
	}

	function ajax_scan() {
		$cleaner = $this->init_cleaner();
		include( 'ui/scan.php' );
		wp_die();
	}

	function csv_redirect() {
		if ( $_SERVER['REQUEST_URI'] == '/download/pw-image-cleaner.csv' ) {
			$cleaner = $this->init_cleaner();
			$filelist = $cleaner->get_orphaned_files();
		}

		if ( isset( $filelist ) ) {
			header("Content-type: application/x-msdownload",true,200);
			header("Content-Disposition: attachment; filename=data.csv");
			header("Pragma: no-cache");
			header("Expires: 0");

			$out = fopen( 'php://output', 'w' );

			fputcsv( $out, array( 'Filename', 'Size (Bytes)' ) );

			if ( !empty( $filelist ) ) {
				foreach ( $filelist as $filename => $filesize ) {
					$basedir = '';
					$upload_dir = wp_upload_dir();
					if ( !empty( $upload_dir ) && is_array( $upload_dir ) ) { $basedir = $upload_dir['basedir']; }
					fputcsv( $out, array( $basedir . '/' . $filename, $filesize ) );
				}
			}

			fclose( $out );

			exit();
		}
	}

	function init_cleaner() {
		if (!class_exists('Pimwick_Cleaner')) {
			require( 'includes/pimwick-cleaner.php' );
		}

		return new Pimwick_Cleaner();
	}
}

new PW_Image_Cleaner();

?>